       cityCode
       country
       countryCode
       latitude
       longitude
       area
       areaCode
       region
       regionCode
     }
     segment: segments {
       state
     }
     history {
       conversionCycleNumber: conversionCycle
       conversionNumber: conversions
       entranceNumber: entrances
       firstConversionTs: firstConversion
       firstViewTs: firstView
       lastConversionTs: lastConversion
       lastViewTs: lastView
       lifetimeValue
       sessionNumber: sessions
       viewNumber: views
     }
   }
 }
